def generate_energy():
    return np.exp(np.random.normal(loc=np.log(10), scale=np.sqrt(2.35))

def generate_spot_size():
    return np.random.uniform(low=3.3, high=3.61)  # Assuming a uniform distribution around the mean for simplicity; adjust as needed

def generate_intensity():
    energy = generate_energy()
    if target_material == 'plastic':
        return np.exp(np.random.normal(loc=np.log(6.22e20), scale=np.sqrt(3.96e41))  # Assuming a log-normal distribution for intensity around the median of plastic samples; this is an approximation and would need refinement based on actual distributions
    else:
        return np.random.normal(loc=np.log(6.22e20), scale=np.sqrt(3.96e41)  # Assuming a log-normal distribution for other materials like aluminium and polypropylene, adjusted based on their specifics

def generate_power():
    return np.random.lognormal(mean=np.log(6.23e13), scale=np.sqrt(4.03e27))

def generate_cutoff_energy(energy):
    # This could be a function based on some complex relationship between energy and cutoff_energy, which isn't specified here
    return np.exp(np.random.normal(loc=np.log(8.64), scale=0.5)  # Simplified for demonstration; the actual relationship would need to be defined based on specifics not provided

def generate_material():
    # Assuming a simple choice of materials for simplicity, but in practice, this could involve more complex logic or categorization
    return np.random.choice(['plastic', 'aluminium', 'polypropylene', 'polystyrene', 'gold'])  # Randomly selecting from the given examples

def generate_data_point():
    material = generate_material()
    thickness = generate_thickness()
    pulse_width = generate_pulse_width()
    energy = generate_energy()
    spot_size = generate_spot_size()
    intensity = generate_intensity() if material == 'plastic' else None  # Assuming different methods for generating intensities based on other materials as needed
    power = generate_power()
    cutoff_energy = generate_cutoff_energy(energy)

    return [material, thickness, pulse_width, energy, spot_size, intensity if intensity is not None else np.nan, power]  # Using NaN for unavailable (different) intensities for other materials

# Main data generation function
def generate_data(num_samples=25):
    samples = []
    for _ in range(num_samples):
        if material == 'plastic':
            intensity = generate_intensity()  # Using the specialized logic for plastic as shown above, adjust based on actual data distributions and relationships
        else:
            intensity = None  # Assumes different logic/distributions for other materials

        samples.append(generate_data_point())
    return np.array(samples)

# Generate the dataset with specified number of samples
